#include <bits/stdc++.h>
#define int long long
using namespace std;

const int kMaxVal = 20000;
const int kMaxN = 2000;
const int kMod = 1169996969;

#ifdef ONLINE_JUDGE
#define dbg(...)
#else
#include "debug.h"
#endif

const string DIGITS =
    "!#$%&'()*+,-./"
    "0123456789:;<=>?@ABCDEFGHIJKLMNOPQRSTUVWXYZ[]^_`"
    "abcdefghijklmnopqrstuvwxyz{|}~";
const int BASE = 92;
int revDigit[128];

void buildRev() {
  fill(revDigit, revDigit + 128, -1);
  for (int i = 0; i < (int)DIGITS.size(); ++i)
    revDigit[(unsigned char)DIGITS[i]] = i;
}

string encode_base92(int x) {
  const int LEN = 5;
  string s(LEN, DIGITS[0]);
  for (int i = LEN - 1; i >= 0; --i) {
    s[i] = DIGITS[x % BASE];
    x /= BASE;
  }
  return s;
}

int decode_base92(const string& s, int pos) {
  const int LEN = 5;
  int v = 0;
  for (int i = 0; i < LEN; ++i) {
    v = v * BASE + revDigit[(unsigned char)s[pos + i]];
  }
  return v;
}

vector<int> primes;
bool is_prime[kMaxVal + 1];
int pf[kMaxN + 1];

void prepare() {
  for (int i = 2; i <= kMaxVal; ++i) is_prime[i] = true;
  is_prime[1] = false;

  for (int i = 2; i * i <= kMaxVal; ++i)
    if (is_prime[i])
      for (int j = i * i; j <= kMaxVal; j += i) is_prime[j] = false;

  for (int i = 2; i <= kMaxVal; ++i)
    if (is_prime[i]) primes.push_back(i);

  pf[0] = primes[0];
  for (int i = 1; i <= kMaxN; ++i) pf[i] = pf[i - 1] + primes[i];
}

void generate() {
  prepare();
  buildRev();

  freopen("code.ans", "w", stdout);

  vector<int> dp(20000000);
  dp[0] = 1;

  for (int i = 0; i < 2000; ++i) {
    int sum = pf[i];

    for (int j = sum; j >= primes[i]; --j)
      dp[j] = (dp[j] + dp[j - primes[i]]) % kMod;

    const int lim = 30;
    for (int p = 1; p <= lim; ++p) {
      for (int q = p; q <= lim; ++q) {
        if (!is_prime[p] || !is_prime[q]) continue;

        int d = p + q;
        if ((p * sum) % d != 0) continue;

        int s = p * sum / d;
        int ans = dp[s];

        if (i > 300) cout << encode_base92(ans);
      }
    }
  }
}

